import React from 'react'

const Navbar = ({icon,title}) => {
    return (
        <div>
            <h1>{icon}</h1>
                <h2>{title}</h2>
            
            
        </div>
    )
}

Navbar.propType={
    icon:PropTypes.object.isRequired,
    title:PropTypes.object.isRequired,
}

Navbar.defaultProps={
    icon:"hello",
    title:'world'
}

export default Navbar
